from xutils import timeit, profile

class Solution:
    
    # @profile()
    @timeit()
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        # 所有的word长度相同
        # 组装所有的可能性
        # 逐个查找
        # @timeit()

        word_length = len(words[0])
        s_length = len(s)
        result = []

        def do_find(result, words_dict0, first, first_pos):
            pos = first_pos
            if pos >= 0:
                words_dict = words_dict0.copy()
                words_dict[first] -= 1
                pos += word_length
                while pos < len(s):
                    next = s[pos:pos+word_length]
                    if words_dict.get(next, 0) > 0:
                        # words_copy.remove(next)
                        words_dict[next] -= 1
                        pos += word_length
                    else:
                        break
                for word in words_dict:
                    if words_dict[word] != 0:
                        return False
                result.append(first_pos)

        total_length = word_length * len(words)
        words_dict = dict()
        for word in words:
            words_dict[word] = words_dict.get(word, 0) + 1
        for word in set(words):
            first = word
            pos = 0
            rest = s_length - pos
            while pos >= 0 and rest >= total_length:
                pos = s.find(first, pos)
                if pos >= 0:
                    do_find(result, words_dict, first, pos)
                    pos += 1
                    rest = len(s) - pos
            
        return sorted(set(result))

        all_pos = []
        pos_matrix = []

        if len("".join(words)) > len(s):
            return []

        def find_all(s, word):
            p = 0
            p = s.find(word)
            result = []
            while p >= 0:
                result.append(p)
                p = s.find(word, p+1)
            return result

        for word in words:
            poslist = find_all(s, word)
            # print(poslist)
            all_pos += poslist
            pos_matrix.append(set(poslist))

        all_pos = sorted(set(all_pos))

        def check_and_remove(matrix, pos):
            for item in matrix:
                if pos in item:
                    matrix.remove(item)
                    return True
            return False

        def find_in_pos(pos_matrix, pos):
            count = 0
            while check_and_remove(pos_matrix, pos):
                count += 1
                if count >= len(words):
                    return True
                pos += word_length
            return False

        for i, pos in enumerate(all_pos):
            rest = len(all_pos) - i
            if rest >= len(words) and find_in_pos(pos_matrix[:], pos):
                result.append(pos)
        return result


        def perm(result, array, pos):
            if pos >= len(array):
                # print(array)
                result.append(''.join(array))
            else:
                prefix = ''.join(array[:pos])
                if s.find(prefix) < 0:
                    return
                cur = pos
                while cur < len(array):
                    # 当前位置和后面的逐个交换
                    array[cur], array[pos] = array[pos], array[cur]
                    perm(result, array, pos + 1)
                    array[pos], array[cur] = array[cur], array[pos]
                    cur += 1
        print("len", len(words))
        new_words = []
        perm(new_words, words, 0)
        result = []
        for word in new_words:
            pos = 0
            pos = s.find(word, pos)
            while pos >= 0:
                result.append(pos)
                pos += 1
                pos = s.find(word, pos)
        return sorted(set(result))

def t(p, s, words):
    sl = Solution()
    r = sl.findSubstring(s, words)
    print('p:', p)
    print('r:', r)
    print()
    assert p == r
    
